import React from "react";

function Footer() {
    const namaMhs = "dede ahmad rivandi";
    return (
        <footer style={{ textAlign: "center", padding: "1rem", backgroundColor: "#f2f2f2" }}>
            <h3>Halaman Footer</h3>
            <p>©2025 Design with ❤ by {namaMhs}</p>
        </footer>
    );
}

export default Footer;
